import axios from 'axios';
// import env from 'dotenv';

export default {
  getSports: () => {
    const { REACT_APP_SPORTSBOOK_API_KEY } = process.env;
    // console.log(key);
    return axios.get(`https://api.the-odds-api.com/v3/sports?apiKey=${ REACT_APP_SPORTSBOOK_API_KEY }`)
  }
};
